import react, { Fragment } from "react";

import mealsImage from "../../";

const Header = (props) => {
  return (
    <Fragment>
      <Header>
        <h1>Foodify</h1>
        <button>cart</button>
      </Header>
      <div>
        <img src={mealsImage} alt="" />
      </div>
    </Fragment>
  );
};

export default Header;
